0_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<p>【藏品名称】SB25 中国首 次载人航天飞行成功 小本票</p>\n<p>【发行时间】2003年10月16日</p>\n<p>【发行单位】国家邮政局</p>\n<p>【发行数量】495万本</p>\n<p>【藏品内容】英姿（大陆）、凯旋（大陆）/英姿（香港）、火箭（香港）/英姿（澳门）、飞船（澳门）</p>\n<p>【邮票规格】40mm×30mm/枚</p>\n<p>【齿孔度数】13×13.5°</p>\n<p>【本票规格】148mm×95mm</p>\n<p>【印制 厂】北京邮票厂</p>\n<p>【设计 者】王虎鸣（邮票、小本票）、刘向平（邮票、插图）</p>\n<p>【图文提供】中国载人航天工程办公室</p>\n<p>【藏品简介】</p>\n<p>2003年10月16日，国家邮政局特别发行《中国首 次载人航天飞行成功》邮票1套2枚，分别是2-1英姿、2-2凯旋；另发行与香港邮政、澳门邮政共同印制的小本票1本，内含国家邮政局、香港邮政署、澳门邮政局分别发行的同题材的邮票小全张各一张，详细区分为 <span>英姿（大陆）、凯旋（大陆）/英姿（香港）、火箭（香港）/英姿（澳门）、飞船（澳门）</span> 。</p>\n<p>小本票及其特点：</p>\n<p>小本票，又称邮票小册。为便于用户携带使用，将一种或几种常用面值的数枚邮票连印在一起，装订成小本册。其特点是：配有简单的或精美的封面、封底，并印有与邮票相关的图案或文字说明；小本里面的邮票与全版张的图案、面值、刷色等基本相同；通常邮票上有一边或二边无齿。</p>\n<p align=\"center\"><img data-src=\"//image.suning.cn/uimg/sop/commodity/386514491769223734848000_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/386514491769223734848000_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<div align=\"center\">2003-特5-中国首 次载人航天飞行成功小本票</div>\n<div><img data-src=\"//image.suning.cn/uimg/sop/commodity/385455965896500259294500_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/385455965896500259294500_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></div>\n<img data-src=\"//image.suning.cn/uimg/sop/commodity/100806480213294602382970_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/100806480213294602382970_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"><br>\n<p>价值一、里程碑纪念沥血之作，收藏价值高。</p>\n<p>为了纪念天中国载人航天飞行成功，国家邮政局于2003年10月16日特别发行《中国首 次载人航天飞行成功》邮票1套2枚，分别是2-1英姿、2-2凯旋。中国航天史上将永远铭刻这一事件，记录下庄重的一页。为纪念中国载人航天飞行成功而发行，是我国航天历史上具有里程碑意义的重大事件，影响深远，收藏价值高。</p>\n<p>价值二、中国太空第1人。</p>\n<p>《中国首 次载人航天飞行成功》邮票主图均有杨 利 伟形象，在他他出太空舱的那一刻实现了中华民族飞出地球的梦想，他也成为了新时代中国人的民族英雄。</p>\n<p>价值三、三地同时发行，收藏影响力惊人。</p>\n<p>《中国首 次载人航天飞行成功》小本票除常规在大陆发行，另发行与香港邮政、澳门邮政共同印制的小本票1本，内含国家邮政局、香港邮政署、澳门邮政局分别发行的同题材的邮票小全张各一张。</p>\n<img data-src=\"//image.suning.cn/uimg/sop/commodity/152809975216971749873265_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/152809975216971749873265_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\">\n<p><img data-src=\"//image.suning.cn/uimg/sop/commodity/913654398381531554826200_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/913654398381531554826200_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<p>2003-特5-中国首 次载人航天飞行成功小本票</p>\n<p align=\"left\"><img data-src=\"//image.suning.cn/uimg/sop/commodity/169898271619005060006182_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/169898271619005060006182_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<p>2003-特5中国首 次载人航天飞机成功小本票</p>\n<p align=\"left\"><img data-src=\"//image.suning.cn/uimg/sop/commodity/125935314649763411592580_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/125935314649763411592580_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<p>2003-特5中国首 次载人航天飞机成功小本票</p>\n<p><img data-src=\"//image.suning.cn/uimg/sop/commodity/819199643479742309638400_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/819199643479742309638400_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p>\n<p><span>2003-特5中国首 次载人航天飞机成功小本票细节</span></p>\n</div>\n</div></div><p><img data-src=\"//image.suning.cn/uimg/sop/commodity/135311702341499736232510_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/135311702341499736232510_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></p></div>','https://image5.suning.cn/uimg/b2c/newcatentries/0070069664-000000000107794173_1_800x800.jpg','https://image5.suning.cn/uimg/b2c/newcat