=\"//image.suning.cn/uimg/sop/richtext/847321628155080927278000.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/847321628155080927278000.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/215957172187885705445410.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/215957172187885705445410.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/119906307526522243053160.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/119906307526522243053160.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/612712439976155521989600.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/612712439976155521989600.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/847483682177572257631010.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/847483682177572257631010.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/123746634019748956507940.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/123746634019748956507940.gif?from=mobile\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/richtext/168449312517429797916340.gif?from=mobile\" alt=\"\" src=\"//image.suning.cn/uimg/sop/richtext/168449312517429797916340.gif?from=mobile\" width=\"100%\" height=\"auto\"></p></div><div moduleid=\"R1203005_5\" modulename=\"安装指南\"><p>               </p></div><div moduleid=\"R1203005_7\" modulename=\"温馨提示\"><p>                 </p></div></div>','https://image2.suning.cn/uimg/b2c/newcatentries/0000000000-000000000102462413_1_800x800.jpg','https://image2.suning.cn/uimg/b2c/newcatentries/0000000000-000000000102462413_1_200x200.jpg','0',1514257122,1514257122,NULL,'手机相机','相机配件','三脚架',0,0,2),(327,'尼康(Nikon) 67mm 中性色彩原装正品NC UV滤镜 适用:18-105/18-140/16-85等',164.00,168,100,'滤镜','<div class=\"lazyimg\"><div moduleid=\"R1203007_4\" modulename=\"商品详情\"><p><img data-src=\"https://image.suning.cn/uimg/sop/commodity/208198767210534754141198_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"https://image.suning.cn/uimg/sop/commodity/208198767210534754141198_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"><img data-src=\"https://image.suning.cn/uimg/sop/commodity/174391204895727974813580_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"https://image.suning.cn/uimg/sop/commodity/174391204895727974813580_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"><img data-src=\"https://image.suning.cn/uimg/sop/commodity/781757937165465309839780_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"https://image.suning.cn/uimg/sop/commodity/781757937165465309839780_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\">尼康尼克尔镜头型号如下（可使用67mm口径滤镜）</p>\n<p>AF-S DX尼克尔16-85mm f/3.5-5.6G ED VR<br>AF-S DX尼克尔18-105mm f/3.5-5.6G ED VR<br>AF-S DX尼克尔18-140mm f/3.5-5.6G ED VR<br>AF-S DX尼克尔18-300mm f/3.5-6.3G ED VR<br>AF-S尼克尔70-200mm f/4G ED VR<br>AF-S VR变焦尼克尔70-300mm f/4.5-5.6G IF-ED<br>AF-S尼克尔28mm f/1.8G<br>AF-S尼克尔35mm f/1.4G<br>AF-S尼克尔85mm f/1.8G</p>\n<p>产品效果： </p>\n<p> 1、有效滤除紫外线而不影响可见光的通过。</p>\n<p> 2、在烈日下拍摄远方景物时可减少雾化现象。</p>\n<p> 3、不影响曝光，对色温只有轻微的影响。可完全替代保护镜使用。 </p>\n<p>产品特点： </p>\n<p>（1）：中性颜色滤镜可以用作镜头的保护镜。它们并不会影响色彩平衡。而且它的多层涂膜可以防止玻璃内的反射光线，改善色彩的重现。 </p>\n<p>（2）：滤镜可以减去紫外光而不影响可见光的透明，在烈日下拍摄远方景物时可减少雾化现象，在使用黑白胶卷时，效果特别明显，不影响曝光，而对色温只有极轻微影响，可代替保护镜片使用。</p>\n<p>（3）：UV镜头可以吸收紫外光线，还原反差鲜明的锐利影像。经多层镀膜处理，能够有效地防止反射光，同时具有保护镜片的作用 </p>\n<p>（4）：UV镜就是紫外线滤光镜（Ultra Violet）。UV镜的主要功能是吸收波长在400毫微米以下紫外线，对其他可见/不可见光线均无过滤作用。过滤的原理是含铅玻璃，所以比较重。</p>\n<p>（5）：UV镜通常无色透明。但是因为有增透膜的影响，可能在某些角度下观看会呈现不同的颜色。 </p>\n<p>（6）：在有雾气的天气和高空环境，紫外线比较强烈，拍出的映像会蒙上一层蓝紫色调。因此，加了UV镜可以将紫外线吸收，排除紫外线对CCD的干扰，有助于提高影响的清晰度和色彩的还原效果。</p>\n<p> </p></div><div moduleid=\"R1203007_5\" modulename=\"安装指南\"><p><img data-src=\"//image.suning.cn/uimg/sop/commodity/1452