>\n\t\t\t<td>\n\t\t\t\t<span><img alt=\"\" data-src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161732.jpg?from=mobile&amp;format=80q.webp\" src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161732.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></span></td>\n\t\t</tr>\n\t</tbody>\n</table>\n<span><br>\n</span>\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 100%; height: auto;\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>\n\t\t\t\t<span>深圳市迪比科电子科技有限公司注册于2004年，是大陆企业家独资投入打造而成的现代化大型高科技电子企业。公司之初以雄厚的资金，高科技的技术含量，充足的人才储备，广阔的市场网络快速向数码电池和充电器市场挺进。经过五年的努力，在以董事长运筹帷幄的领导之下，在全体公司人员精诚团结，锐意进取的拼搏奋斗中，公司已逐渐扩大了四家分厂，拥有行业顶尖科技研发人员和专业制造人员1200多人，生产商品种类也由开始的专精于数码电池和充电器到今天全面性生产数码产品配件的升级，涉足到数码产品电池、DV/DC无绳电话、笔记本、PDA、MP3、MP4电池和PCB以及充电器等多种数码产品配件的市场需要。除此以外，迪比科还致力于研究和发展单反手柄，成功的实行了生产行业跨越，完美的研发生产出来了领先于现行市场国内同行业的数码相机手柄，并成功的在市场上进行推广，创立了有市场影响力的“斯丹德”品牌。目前迪比科旗下的各个工厂月产能共达到800000PCS产品，为迪比科遍布海内外的客人们提供坚实的商品后盾基础。</span></td>\n\t\t</tr>\n\t</tbody>\n</table>\n<span><br>\n</span>\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 100%; height: auto;\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>\n\t\t\t\t<span><img alt=\"\" data-src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161829.jpg?from=mobile&amp;format=80q.webp\" src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161829.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></span></td>\n\t\t</tr>\n\t</tbody>\n</table>\n<span><br>\n</span>\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 100%; height: auto;\">\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>\n\t\t\t\t<span><img alt=\"\" data-src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161846.jpg?from=mobile&amp;format=80q.webp\" src=\"//image.suning.cn/images/nrgl/cpjs/102528428_20120715161846.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"></span></td>\n\t\t</tr>\n\t</tbody>\n</table>\n<span><br>\n</span>\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 1